B.Yr=new A.a0("Die Sammlungen sind so gestaltet, dass du das Bed\xfcrfnis versp\xfcrst, jedes einzelne Item zu erwerben, um die vollst\xe4ndige Belohnung zu erhalten. Oft fehlt dir am Ende nur noch ein kleines Teil, und das Spiel bietet dir gezielt die M\xf6glichkeit, dieses fehlende Item entweder durch stundenlanges Spielen oder gegen echtes Geld zu bekommen. Hast du bemerkt, wie zufriedenstellend es ist, eine Sammlung abzuschlie\xdfen? Oder dass du immer wieder spielst oder sogar Geld ausgibst, nur um das letzte Teil zu erhalten? Das ist genau so beabsichtigt: Spieleentwickler wollen, dass du dich motiviert f\xfchlst, diese letzte L\xfccke zu f\xfcllen, indem du mehr Zeit im Spiel verbringst oder Geld investierst, um das Gef\xfchl der Vollst\xe4ndigkeit zu erreichen.",null,null,null,null,null,null,null,null)
